drop table if exists "Match";

drop table if exists "Stadium";

drop table if exists "Nationality";

create table "Nationality" ("country" text, "continent" text not null, "group" varchar(1) not null);
alter table "Nationality" add constraint "Nationality_pkey" primary key ("country");

create table "Stadium" ("name" text, "city" text not null, "country" text not null, "capacity" integer not null);
alter table "Stadium" add constraint "Stadium_pkey" primary key ("name");
alter table "Stadium" add constraint "stadium_country_foreign" foreign key ("country") references "Nationality" ("country");

create table "Match" ("stadium" text not null, "date" date not null, "time" time not null, "home" text not null, "guest" text not null);
alter table "Match" add constraint "match_home_foreign" foreign key ("home") references "Nationality" ("country");
alter table "Match" add constraint "match_guest_foreign" foreign key ("guest") references "Nationality" ("country");
alter table "Match" add constraint "Match_pkey" primary key ("stadium", "date", "time");

